import React from 'react';
// import "./NavBar.css";
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, NavItem } from 'reactstrap';
import logo from './images/MusicMatchLogoWhiteSmall.png';


function NavBar() {

  return (
    <div classNmae="justify-content-center">
      <div>
        <a className="justify-content-center"><img src={logo} className="justify-content-center"></img></a>
      </div>
      <Navbar expand="md" className="justify-content-center ml-auto">
        <NavLink exact to="/" className="justify-content-center"></NavLink>
        <NavLink to="/" className="justify-content-center">Logout</NavLink>

        <Nav className="ml-auto" navbar>
        </Nav>
      </Navbar>
    </div >
  );
}

export default NavBar;
